"challenge.intro_2": "\u062a\u062a\u0643\u0648\u0646 \u0643\u0644 \u0644\u0639\u0628\u0629 \u062a\u062d\u062f\u064a \u0645\u0646 \u062c\u0648\u0644\u0629 \u0648\u0627\u062d\u062f\u0629 \u0645\u0639 \u0645\u0624\u0642\u062a \u062c\u0648\u0644\u0629 \u0637\u0648\u064a\u0644. \u0643\u0645\u0627 \u0628\u0625\u0645\u0643\u0627\u0646\u0643 \u0625\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0642\u062f\u0631\u0627\u062a \u0627\u0644\u0645\u062e\u062a\u0644\u0641\u0629 \u0641\u064a \u0627\u0644\u0644\u0639\u0628\u0629.",
