"welcome to jawaker! this quick guide will help you get started in no time!": "Jawaker'e ho\u015f geldin. Bu k\u0131sa kilavuzu en k\u0131sa zamanda oynayabilmek i\xe7in yard\u0131mc\u0131 olabilir.",
"this is a list of the games currently available on jawaker. click your favorite game to proceed to the next step!": "Jawaker'deki b\xfct\xfcn oyunlar bu listede bulunur. Sevdi\u011fin oyuna t\u0131klayarak sonraki ad\u0131ma atlayabilirsin",
"this bar indicates your experience points. you should get the required number of points to move to the next level.": "Bu \xe7ubuk deneyim puanlar\u0131n\u0131 g\xf6sterir. Sonraki seviyeye atlamak i\xe7in gereken puan\u0131 kazanmal\u0131s\u0131n",
"tokens are jawaker's virtual currency and are used to buy various goods and services on the site.": "Puan, Jawaker'in sanal paras\u0131d\u0131r ve sitede bulunan \xfcr\xfcnler ve hizmetleri sat\u0131n almak i\xe7in kullan\u0131l\u0131r",
"you can click this button at any time to learn how to use various features on jawaker.": "Her anda bu d\xfc\u011fmeye t\u0131klayabilir ve Jawaker'in \xf6zellikleri nas\u0131l kullan\u0131labilece\u011fini \xf6\u011frenebilirsin",
'our exclusive premium service, "jawaker basha", gives you more privileges and allows you to experience jawaker from a different and superior angle, click here to learn more about these privileges.': "'Jawaker Pa\u015fa' \xf6zel hizmetimizin sundu\u011fu \xf6zellikerle Jawaker'i bamba\u015fka bir \u015fekilde oynayabilirsin. Daha fazla bilgi i\xe7in buraya t\u0131klay\u0131n.",
"you can click this button to go to a random game and start playing immediately.": "Bu ba\u011flant\u0131ya t\u0131klayarak rasgele oyuna girip hemen oynayabilirsin",
"this is a list of new and currently running games, if there are empty seats in the game you can join it right away by clicking the green or yellow button, or you can enter any game as a viewer.": "Burada yeni kurulan ve devam eden oyunlar\u0131n listesi bulunuyor. Bo\u015f yer bulundu\u011fu takdirde Sar\u0131 ve Ye\u015fil d\xfc\u011fmeye t\u0131klayarak oyuna hemen kat\u0131labilir veya her hangi bir oyuna izleyici olarak da kat\u0131labilirsin.",
"competitions are a great way to test your skill against other players! select your favorite game to see the available competitions.": "Yar\u0131\u015fmalarda, yetene\u011fini di\u011fer oyuncular\u0131n yetenekleri ile kar\u015f\u0131la\u015ft\u0131rabilirsin. Ba\u015flamak i\xe7in, favori oyununu se\xe7.",
"this is a list of new competitions that you can join. check the start date and the organizer rating then select the competition you'd like to join.": "Ba\u015flama tarihi ve oyunu kuran ki\u015finin reytingini kontrol ederek kat\u0131lmak istedi\u011fin yar\u0131\u015fmay\u0131 se\xe7ebilirsin.",
"this is where you can see the full details of the competition including the entry fee and the prize you can win.": "Burada, yar\u0131\u015fman\u0131n detayli bilgileri, fiyatleri ve \xf6d\xfcllerini g\xf6rebilirsin",
"click this button to send a request to the organizer to join the competition. if the organizer accepts the request, your name will be added to the list of players, otherwise, the entry fee you paid will be added back to your account no later than the competition start time.": "Yar\u0131\u015fmaya kat\u0131l\u0131m iste\u011fini g\xf6ndermek i\xe7in bu ba\u011flant\u0131ya t\u0131kla. Kabul oldu\u011fu takdirde, ismin oyuncu listesine eklenecektir. Aksi takdirde, hesab\u0131ndan kesilen puan en ge\xe7 yar\u0131\u015fma ba\u015flayana kadar geri verilecektir.",
"make sure to be available on jawaker at least 10 minutes before the competition start time and you'll receive a notification to go to the first game, or you can visit this page and click on the link below your group to go to the game.": "L\xfctfen, yar\u0131\u015fmadan en az 10 dakika \xf6nce Jawaker'de bulunup sana g\xf6nderilecek birinci oyuna kat\u0131l\u0131m bildirimini bekleyebilir yada bu sayfay\u0131 ziyaret edip grubunun alt\u0131ndaki ba\u011flant\u0131ya t\u0131klayarak oyuna kat\u0131labilirsin.",
"once you're done with the competition, make sure to visit this page and vote for the organizer according to how well the competition was managed. this will help you and other players to avoid bad organizers in the future.": "Yar\u0131\u015fma bitti\u011fi zaman, yar\u0131\u015fma sayfas\u0131na girip yar\u0131\u015fmay\u0131 d\xfczenleyeni de\u011ferlendirerek di\u011fer arkada\u015flar\u0131 k\xf6t\xfc yar\u0131\u015fmalara kat\u0131lmaktan kurtarabilirsin.",
